import { useSelector } from "react-redux";
import Filter from "./Filter.tsx"; 
import { changePrivacyFilter } from "../store/groupSlice";

export default function PrivacyFilter() {
  const privacyFilter = useSelector(state=> state.groups.privacyFilter )
  const options = [
    {
      value: null,
      label: "Все",
    },
    {
      value: false,
      label: "открытая",
    },
    {
      value: true,
      label: "закрытая",
    },
  ];
  return (
    <Filter
      placeholder="типу приватности"
      options={options}
      setFilter={changePrivacyFilter}
      value={privacyFilter}
    />
  );
}

